/// List companies
/// 
/// A List of companies
/// - Requires: `API Tier 1`
/// - Expandable fields: `legal_entities`
/// - Sortable fields: `id`, `created_at`, `updated_at`
/// 
/// **Parameters:**
/// 
/// - `cursor: Option<String>`
/// - `expand: Option<String>`
/// - `order_by: Option<String>`
async fn example_companies_list() -> anyhow::Result<()> {
    let client = rippling_api::Client::new_from_env();
    let result: rippling_api::types::ListCompaniesResponse = client
        .companies()
        .list(
            Some("some-string".to_string()),
            Some("some-string".to_string()),
            Some("some-string".to_string()),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}


